const h3Style = {
  fontSize: "40px",
  backgroundColor: "rgb(240, 255, 255)",
  color: "rgb(31, 45, 61)",
  padding: "10px",
  margin: 0,
};
const dataDetailStyle = {
  display: "inline-block",
  padding: "0px 65px",
};

const bListliStyle = {
  display: "inline-block",
  paddingRight: "10px",
};

const buttonStyle = {
  background: "none",
};

export default {
  buttonStyle,
  bListliStyle,
  dataDetailStyle,
  h3Style,
};
